import React from 'react';
import { useState } from "react";
// import { getDatabase, ref, push as firebasePush } from 'firebase/database';

function FormComponents(props) {
  console.log("FormComponents is rendering"); // Debug log

  const [typedFNameInput, setTypedFNameInput] = useState("");
  const [typedLNameInput, setTypedLNameInput] = useState("");
  const [typedEmailInput, setTypedEmailInput] = useState("");
  const [typedPhoneInput, setTypedPhoneInput] = useState("");
  const [typedBizNameInput, setTypedBizNameInput] = useState("");
  const [typedBizTypeInput, setTtypedBizTypeInput] = useState("");
  const [chosenExpenseInput, setChosenExpenseInput] = useState("");
  const [selectedTagInput, setSelectedTagInput] = useState("");
  const [typedBizLocInput, setTypedBizLocInput] = useState("");
  // need to add image upload section
  const [imageInput, setImageInput] = useState("Select"); 
  const [typedBizDescInput, setTypedBizDescInput] = useState("");



  const handleFNameChange = (event) => {
    const value = event.target.value; //what user typed in
    setTypedFNameInput(value);
  }

  const handleLNameChange = (event) => {
    const value = event.target.value; //what user typed in
    setTypedLNameInput(value);
  }

  const handleEmailChange = (event) => {
    const value = event.target.value; //what user typed in
    setTypedEmailInput(value);
  }

  const handlePhoneChange = (event) => {
    const value = event.target.value; //what user typed in
    setTypedPhoneInput(value);
  }

  const handleBizNameChange = (event) => {
    const value = event.target.value; //what user typed in
    setTypedBizNameInput(value);
  }

  const handleBizDescChange = (event) => {
    const value = event.target.value; //what user typed in
    setTypedBizDescInput(value);
  }

  const handleBizTypeClick = (event) => {
    const value = event.target.value;
    setTtypedBizTypeInput(value);
  }

  const handleChosenExpense = (event) => {
    const value = event.target.value;
    setSelectedTagInput(value);
  }

  const handleBizLocClick = (event) => {
    const value = event.target.value;
    setTypedBizLocInput(value);
  }

  const handleUploadedImg = (event) => {
    const value = event.target.value;
    setImageInput(value);
  }

  const handleSelectedTags = (event) => {
    const values = event.target.values;
    setSelectedTagInput(values);
  }

  const handleSubmit = (event) => {
    setTypedFNameInput("");
    setTypedLNameInput("");
    setTypedEmailInput("");
    setTypedPhoneInput("");
    setTypedBizNameInput("")
    setTypedBizDescInput("");
    setTtypedBizTypeInput("");
    setTypedBizLocInput("");
    setSelectedTagInput("");
    setChosenExpenseInput("");
    setImageInput("");
  }

  return (
    <div className="container my-5">
      <div className="row justify-content-center">
        <div className="col-lg-8">
          <div className="card shadow-lg border-0">
            <div className="card-body p-5">
              <div className="text-center mb-5">
                <img src="/logo.svg" alt="Shop Local Hawaii Logo" className="mb-3" style={{ width: '60px', height: '60px' }} />
                <h2 className="card-title">Register Your Business</h2>
                <p className="text-muted">Join our community of local Hawaiian businesses</p>
              </div>

              <form>
                <div className="row">
                  <div className="col-md-6 mb-3">
                    <label className="form-label fw-bold">First Name *</label>
                    <input 
                      type='text' 
                      className="form-control form-control-lg"
                      value={typedFNameInput}
                      onChange={handleFNameChange}
                      placeholder="Enter your first name"
                      required 
                    />
                  </div>
                  <div className="col-md-6 mb-3">
                    <label className="form-label fw-bold">Last Name *</label>
                    <input
                      type='text' 
                      className="form-control form-control-lg"
                      value={typedLNameInput}
                      onChange={handleLNameChange}
                      placeholder="Enter your last name"
                      required 
                    />
                  </div>
                </div>

                <div className="row">
                  <div className="col-md-6 mb-3">
                    <label className="form-label fw-bold">Email Address *</label>
                    <input
                      type='email' 
                      className="form-control form-control-lg"
                      value={typedEmailInput}
                      onChange={handleEmailChange}
                      placeholder="business@email.com"
                      required 
                    />
                  </div>
                  <div className="col-md-6 mb-3">
                    <label className="form-label fw-bold">Phone Number *</label>
                    <input
                      type="tel" 
                      className="form-control form-control-lg"
                      value={typedPhoneInput}
                      onChange={handlePhoneChange}
                      placeholder="(808) 555-0123"
                      required 
                    />
                  </div>
                </div>

                <div className="mb-3">
                  <label className="form-label fw-bold">Business Name *</label>
                  <input
                    type="text" 
                    className="form-control form-control-lg"
                    value={typedBizNameInput}
                    onChange={handleBizNameChange}
                    placeholder="Enter your business name"
                    required 
                  />
                </div>

                <div className="row">
                  <div className="col-md-6 mb-3">
                    <label className="form-label fw-bold">Business Type *</label>
                    <select className="form-select form-select-lg" value={typedBizTypeInput} onChange={handleBizTypeClick}>
                      <option value="">Select business type</option>
                      <option value="hotel">Hotel</option>
                      <option value="dining">Dining</option>
                      <option value="activity">Activity</option>
                    </select>
                  </div>
                  <div className="col-md-6 mb-3">
                    <label className="form-label fw-bold">Price Range *</label>
                    <select className="form-select form-select-lg" value={chosenExpenseInput} onChange={handleChosenExpense}>
                      <option value="">Select price range</option>
                      <option value="$">$ (Budget-friendly)</option>
                      <option value="$$">$$ (Moderate)</option>
                      <option value="$$$">$$$ (Premium)</option>
                      <option value="$$$$">$$$$ (Luxury)</option>
                    </select>
                  </div>
                </div>

                <div className="mb-3">
                  <label className="form-label fw-bold">Business Location *</label>
                  <select className="form-select form-select-lg" value={typedBizLocInput} onChange={handleBizLocClick}>
                    <option value="">Select island</option>
                    <option value="Maui">Maui</option>
                    <option value="Hawaii">Hawaii (Big Island)</option>
                    <option value="Oahu">Oahu</option>
                    <option value="Molokai">Molokai</option>
                    <option value="Lna'i">Lna'i</option>
                    <option value="Kaua'i">Kaua'i</option>
                  </select>
                </div>

                <div className="mb-3">
                  <label className="form-label fw-bold">Amenities & Features</label>
                  <select multiple className="form-select form-select-lg" value={selectedTagInput} onChange={handleSelectedTags} style={{ height: '120px' }}>
                    <option value="Free Wi-Fi">Free Wi-Fi</option>
                    <option value="Air conditioning">Air conditioning</option>
                    <option value="Beach access">Beach access</option>
                    <option value="Free parking">Free parking</option>
                    <option value="Outdoor pool">Outdoor pool</option>
                    <option value="Free breakfast">Free breakfast</option>
                    <option value="Airport shuttle">Airport shuttle</option>
                    <option value="Kid-friendly">Kid-friendly</option>
                    <option value="Fitness center">Fitness center</option>
                    <option value="Beach front">Beach front</option>
                    <option value="Kitchen in rooms">Kitchen in rooms</option>
                    <option value="Bar">Bar</option>
                    <option value="Oceanfront">Oceanfront</option>
                    <option value="Luau">Luau</option>
                    <option value="Live Music">Live Music</option>
                    <option value="Culture">Culture</option>
                  </select>
                  <div className="form-text">Hold Ctrl (or Cmd on Mac) to select multiple options</div>
                </div>

                <div className="mb-3">
                  <label className="form-label fw-bold">Business Description *</label>
                  <textarea 
                    className="form-control form-control-lg"
                    value={typedBizDescInput}
                    onChange={handleBizDescChange}
                    placeholder="Tell us about your business, what makes it unique, and what visitors can expect..."
                    rows="4"
                    required 
                  />
                </div>

                <div className="mb-4">
                  <label className="form-label fw-bold">Business Images</label>
                  <input
                    type="file"
                    className="form-control form-control-lg"
                    accept="image/*"
                    multiple
                  />
                  <div className="form-text">Upload photos of your business (optional)</div>
                </div>

                <div className="d-grid gap-2">
                  <button 
                    className="btn btn-primary btn-lg" 
                    type="button" 
                    onClick={handleSubmit}
                    style={{ 
                      backgroundColor: '#ABC9FF', 
                      borderColor: '#ABC9FF',
                      color: '#000',
                      fontWeight: 'bold',
                      padding: '1rem 2rem'
                    }}
                  >
                    Submit Registration
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export function FormPage(props) {
  console.log("FormPage component is rendering");

  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    businessName: '',
    businessType: '',
    priceRange: '',
    location: '',
    description: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    alert('Form submitted successfully!');
  };

  return (
    <div style={{ 
      padding: '2rem', 
      maxWidth: '800px', 
      margin: '0 auto',
      backgroundColor: 'white',
      borderRadius: '10px',
      boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
      marginTop: '2rem'
    }}>
      <h1 style={{ textAlign: 'center', color: '#2c3e50', marginBottom: '2rem' }}>
        Register Your Business
      </h1>

      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem', fontWeight: 'bold' }}>
            First Name *
          </label>
          <input
            type="text"
            name="firstName"
            value={formData.firstName}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '0.75rem',
              border: '2px solid #e9ecef',
              borderRadius: '8px',
              fontSize: '1rem'
            }}
          />
        </div>

        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem', fontWeight: 'bold' }}>
            Last Name *
          </label>
          <input
            type="text"
            name="lastName"
            value={formData.lastName}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '0.75rem',
              border: '2px solid #e9ecef',
              borderRadius: '8px',
              fontSize: '1rem'
            }}
          />
        </div>

        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem', fontWeight: 'bold' }}>
            Email Address *
          </label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '0.75rem',
              border: '2px solid #e9ecef',
              borderRadius: '8px',
              fontSize: '1rem'
            }}
          />
        </div>

        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem', fontWeight: 'bold' }}>
            Business Name *
          </label>
          <input
            type="text"
            name="businessName"
            value={formData.businessName}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '0.75rem',
              border: '2px solid #e9ecef',
              borderRadius: '8px',
              fontSize: '1rem'
            }}
          />
        </div>

        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem', fontWeight: 'bold' }}>
            Business Type *
          </label>
          <select
            name="businessType"
            value={formData.businessType}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '0.75rem',
              border: '2px solid #e9ecef',
              borderRadius: '8px',
              fontSize: '1rem'
            }}
          >
            <option value="">Select business type</option>
            <option value="hotel">Hotel</option>
            <option value="dining">Dining</option>
            <option value="activity">Activity</option>
          </select>
        </div>

        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem', fontWeight: 'bold' }}>
            Business Location *
          </label>
          <select
            name="location"
            value={formData.location}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '0.75rem',
              border: '2px solid #e9ecef',
              borderRadius: '8px',
              fontSize: '1rem'
            }}
          >
            <option value="">Select island</option>
            <option value="Maui">Maui</option>
            <option value="Hawaii">Hawaii (Big Island)</option>
            <option value="Oahu">Oahu</option>
            <option value="Molokai">Molokai</option>
            <option value="Lanai">Lanai</option>
            <option value="Kauai">Kauai</option>
          </select>
        </div>

        <div style={{ marginBottom: '1rem' }}>
          <label style={{ display: 'block', marginBottom: '0.5rem', fontWeight: 'bold' }}>
            Business Description *
          </label>
          <textarea
            name="description"
            value={formData.description}
            onChange={handleChange}
            required
            rows="4"
            style={{
              width: '100%',
              padding: '0.75rem',
              border: '2px solid #e9ecef',
              borderRadius: '8px',
              fontSize: '1rem',
              resize: 'vertical'
            }}
            placeholder="Tell us about your business..."
          />
        </div>

        <button
          type="submit"
          style={{
            width: '100%',
            padding: '1rem',
            backgroundColor: '#ABC9FF',
            color: '#2c3e50',
            border: 'none',
            borderRadius: '8px',
            fontSize: '1.1rem',
            fontWeight: 'bold',
            cursor: 'pointer',
            transition: 'background-color 0.3s ease'
          }}
          onMouseOver={(e) => e.target.style.backgroundColor = '#8BB8FF'}
          onMouseOut={(e) => e.target.style.backgroundColor = '#ABC9FF'}
        >
          Submit Registration
        </button>
      </form>
    </div>
  );
}
